//         <a>{props.id}</a>
//       </Link>
//     </li>
//   );


const Index = (props) => {

    // console.log(props);

    const shows = props.data;




    return (
        <Layout>
        <h1>My Blog</h1>


            {shows.map((show)=>{
                return <li key={show.show.id}><Link href="/p/[id]" as={`/p/${show.show.id}`}><a>{show.show.name}</a></Link></li>
            })}



        </Layout>
    )
}

Index.getInitialProps = async()=>{

    let res = await axios.get('https://api.tvmaze.com/search/shows?q=batman')

    let data = await res.data;

    // console.log("show Data ::", data);

    return {
        data:data
    }

}

export default Index


